import React from 'react';
import Drawer from '@material-ui/core/Drawer';
import AppBar from '@material-ui/core/AppBar';
import CssBaseline from '@material-ui/core/CssBaseline';
import Toolbar from '@material-ui/core/Toolbar';
import List from '@material-ui/core/List';
import Typography from '@material-ui/core/Typography';
import Divider from '@material-ui/core/Divider';
import ListItem from '@material-ui/core/ListItem';
import ListItemIcon from '@material-ui/core/ListItemIcon';
import ListItemText from '@material-ui/core/ListItemText';
import InboxIcon from '@material-ui/icons/MoveToInbox';
import MailIcon from '@material-ui/icons/Mail';
import Container from '@material-ui/core/Container';
import Button from '@material-ui/core/Button';
import {Link} from "react-router-dom";
import {useStyles} from "./LayoutUseStyles";
import Logo from "./includes/Logo";


function Copyright() {
    return (
        <Typography variant="body2" color="textSecondary">
            {'Copyright © '}

            <span>Artworch</span>{' '}

            {new Date().getFullYear()}
            {'.'}
        </Typography>
    );
}

export default function WithLayout(Component, props) {
    const classes = useStyles();

    return class WithLayout extends React.Component {

        render() {
            return (
                <div className={classes.root}>
                    <CssBaseline/>

                    <AppBar position="fixed" className={classes.appBar} color="default">
                        <Toolbar disableGutters style={{padding: '0 4px',}}>


                            <Logo/>
                            <Typography variant="h6" className={classes.title}>
                                {props.title}
                            </Typography>


                            <Button component={Link} to="/compositions" color='inherit'>
                                Compositions
                            </Button>
                            <Button component={Link} to="/login" color='inherit'>
                                Login
                            </Button>

                        </Toolbar>
                    </AppBar>

                    <Drawer
                        className={classes.drawer}
                        variant="permanent"
                        classes={{
                            paper: classes.drawerPaper,
                        }}
                    >
                        <div className={classes.toolbar}/>
                        <List>
                            {['Inbox', 'Starred', 'Send email', 'Drafts'].map((text, index) => (
                                <ListItem button key={text}>
                                    <ListItemIcon>{index % 2 === 0 ? <InboxIcon/> : <MailIcon/>}</ListItemIcon>
                                    <ListItemText primary={text}/>
                                </ListItem>
                            ))}
                        </List>
                        <Divider/>
                        <List>
                            {['All mail', 'Trash', 'Spam'].map((text, index) => (
                                <ListItem button key={text}>
                                    <ListItemIcon>{index % 2 === 0 ? <InboxIcon/> : <MailIcon/>}</ListItemIcon>
                                    <ListItemText primary={text}/>
                                </ListItem>
                            ))}
                        </List>
                    </Drawer>

                    <div className={classes.wrapper}>
                        <div className={classes.content}>
                            <div className={classes.toolbar}/>
                            <main>
                                {props.children}
                            </main>
                        </div>
                        <footer className={classes.footer}>
                            <Container maxWidth="sm">
                                <Typography variant="body1">My sticky footer can be found here.</Typography>
                                <Copyright/>
                            </Container>
                        </footer>
                    </div>
                </div>
            );
        }
    }
}
